    [],nt"num_tags": 7,nt"name": "tewaukon-national-wildlife-refuge-narrative-report-may-june-july-august-1963",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Tewaukon NWR
    outlines Refuge accomplishments from May through August of 1963. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, raptors, fish,
    reptiles, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, plantings, collections and receipts, and vegetation
    control. Resource management is outlined; topics include grazing and fur harvesting.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, and safety. Items of interest, N-R forms, and photographs
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
